import React, { Component } from 'react';


export default class LayoutTemplateFooter extends Component {

    constructor(props) {
        super(props);
        this.state = {
        }
    }


    render() {

        return (
            <footer id="footer" class="footer haslayout">
                <div class="footer-description haslayout small-padding-section" style={{ padding: "19px 0 19px 0" }}>
                    <div class="container">
                        <div class="col-md-6 col-md-offset-3">
                            <div class="row">
                                <span class="copyright">&copy; 2005 All Right Reserved <a href="#">CeciStyle Corp</a></span>
                            </div>
                        </div>
                    </div>
                </div>
                <div class="payment haslayout small-padding-section">
                    <div class="container">
                        <ul>
                            <li><i class="fa fa-cc-paypal"></i></li>
                            <li><i class="fa fa-cc-visa"></i></li>
                            <li><i class="fa fa-cc-venmo"></i></li>
                        </ul>
                    </div>
                </div>
            </footer>
        )
    }
}
